import React from "react";
import { withStyles } from "@material-ui/core/styles";
import Button from "@material-ui/core/Button";
import Card from "@material-ui/core/Card";

const styles = theme => ({
  HPSBlue: {
    backgroundColor: "#1C80B5",
    fontFamily: "'Roboto', 'Helvetica', 'Arial', sans-serif",
    fontSize: "18px",
    margin: theme.spacing.unit,
    color: "#FFFFF"
  },
  default: {
    backgroundColor: "#F0F0F0",
    fontFamily: "'Roboto', 'Helvetica', 'Arial', sans-serif",
    fontSize: "18px",
    margin: theme.spacing.unit,
    color: "#999794"
  },
  card: {
    maxWidth: 345
  }
});
class LineOfBusiness extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      individual: false
    };
  }
  changeIndividual = () => {
    if (this.state.individual === true) {
      this.setState({ individual: false });
    } else this.setState({ individual: true });
  };
  render() {
    const { classes } = this.props;
    return (
      <Card className={classes.card}>
        <Button
          variant="outlined"
          onClick={this.changeIndividual}
          className={
            this.state.individual === true ? classes.HPSBlue : classes.default
          }
        >
          individual
        </Button>
      </Card>
    );
  }
}
export default withStyles(styles)(LineOfBusiness);
